class Interpolator {
    constructor () {
        this.previousData = 0;
        this.currentData = 0;


        this.dataPoints = [[new Date().getTime(), 0]];
    }

    addDataPoint (data) {
        // console.log(this.dataPoints)
        console.log(this.timeStamps)
        this.dataPoints.push([new Date().getTime(), data]);
        while (this.timeStamps.length > 20) {
            this.timeStamps.shift();
        }

    }
}

export default Interpolator;
